import React from 'react';


class  Register extends React.Component {
    constructor(props){
       
        this.state = {
            registerName: '',
            registerEmail: '',
            registerPassword: ''
        }
    }

    onNameChange = (event) => {
        this.setState({registerName: event.target.value})
    }


    onEmailChange = (event) => {
        this.setState({registerEmail: event.target.value})
    }

    onPasswordChange = (event) => {
        this.setState({registerPassword: event.target.value})
    }

    
    render(){
        return (
            <div className="form_container" style={{boxShadow: '3px 3px 4px grey', borderRadius:'3px'}}>
                <form >
                    <h1>{'Register'}</h1>
                    <input onChange={this.onNameChange} id="name" type="text" placeholder="Name" />
                    <input onChange={this.onEmailChange} id="email" type="email" placeholder="Email" />
                    <input onChange={this.on} id="password" type="password" placeholder="Password" />
                    <button 
                        type='button' 
                        onClick={()=>onRouteChange('home')}>Register</button>
                    
                    
                    
                </form>
            </div>
            
        );
    }
    
}
export default Register;
